const st={title:BOOK.title||'MyBook',pages:BOOK.pages||[],index:0};
const el={img:document.getElementById('pageImg'),title:document.getElementById('title'),counter:document.getElementById('counter'),stage:document.getElementById('stage'),prev:document.getElementById('prevBtn'),next:document.getElementById('nextBtn'),fs:document.getElementById('fsBtn')};
function upd(){el.counter.textContent=`${st.pages.length?st.index+1:0} / ${st.pages.length}`;el.prev.disabled=!st.pages.length||st.index<=0;el.next.disabled=!st.pages.length||st.index>=st.pages.length-1;}
function ren(){if(!st.pages.length){el.img.removeAttribute('src');upd();return} el.img.src=st.pages[st.index].dataUrl;upd();}
el.prev.addEventListener('click',()=>{if(st.index>0){st.index--;ren();}}); el.next.addEventListener('click',()=>{if(st.index<st.pages.length-1){st.index++;ren();}});
window.addEventListener('keydown',e=>{if(e.key==='ArrowLeft')el.prev.click(); if(e.key==='ArrowRight')el.next.click();});
let x=null,y=null,sw=false; el.stage.addEventListener('touchstart',e=>{const t=e.touches[0];if(!t)return;x=t.clientX;y=t.clientY;sw=false;},{passive:true});
el.stage.addEventListener('touchmove',e=>{if(x==null)return;const t=e.touches[0],dx=t.clientX-x,dy=t.clientY-y;if(Math.abs(dx)>40&&Math.abs(dx)>Math.abs(dy)&&!sw){sw=true; if(dx<0)el.next.click(); else el.prev.click(); x=y=null;}},{passive:true});
el.stage.addEventListener('touchend',()=>{x=y=null;});
el.fs.addEventListener('click',async()=>{try{if(!document.fullscreenElement){await document.documentElement.requestFullscreen();}else{await document.exitFullscreen();}}catch(e){}});
el.title.textContent=st.title; ren();
</script></body></html>
